import {GetUsers} from "../thanks/thankRegistration"

export const GetUsersMannager=()=>{

   let [myusers, setmyusers] = useState()

   useEffect(async()=>{
            debugger
        let  ListUsers = await GetUsers()
        console.log(ListUsers)
        debugger
        setmyusers(ListUsers)
        }) ;

    // const seeUsers=async()=>{
    // let ListUsers = await GetUsers();
    // console.log(ListUsers)
