    return<>
    {/* <input type="button" value="get user" onClick={seeUsers()}></input> */}



    <p>כל המשתמשים שלנו</p> 
    <table>
        <tr>
            <th>קוד משתמש</th>
            <th>שם משתמש</th>
            <th>סיסמת משתמש</th>
            <th>כתובת מייל </th>
        </tr>
        { 
            myusers != undefined && 
            myusers.length > 0 &&
            myusers.map((item) =>
            <tr>
                <td>{item.id}</td>  
                <td>{item.name}</td>  
                <td>{item.password}</td>
                <td>{item.mail}</td>   
            </tr>)
        }
        
    </table>

    </>
}
